def ReverseComp(text):
    reverse_comp = ""
    for c in text:
        if c == 'A':
            reverse_comp = 'T' + reverse_comp
        elif c == 'T':
            reverse_comp = 'A' + reverse_comp
        elif c == 'C':
            reverse_comp = 'G' + reverse_comp
        elif c == 'G':
            reverse_comp = 'C' + reverse_comp

    return reverse_comp


text = ""

print(ReverseComp(text))